import React, {useContext, useEffect} from 'react';
import {Col, Row} from "react-bootstrap";
import TruckCard from "../Components/TruckCard";
import IntervalSelector from "../Components/IntervalSelector";
import {LOAD_TRUCKS} from "../Supporting Files/reducer";
import {Context} from "../App";

const TableBlockStyle = {
    margin: "20px 15%",
    textAlign: 'center',
}

const TableCardStyle = {
    display: "inline-block",
    margin: "8px 8px 8px 0px",
}

function Rent(trucks, brands) {
    const { dispatch } = useContext(Context)

    useEffect(()=>{
        dispatch({
            type: LOAD_TRUCKS,
            payload: {}
        })
    },[])

    return (
        <>
            <IntervalSelector/>
            {
                console.log("STATE RENT")
            }
            {
                console.log(trucks)
            }
            <Row className="g-4" style={TableBlockStyle}>
                {trucks.map((item, index)=>{
                    return<Col>
                        <TruckCard id={item.pk}
                                   name={item.title}
                                   price={item.price}
                                   brand={brands[index]}
                                   capacity={item.capacity}
                                   image={item.photo}
                                   isSelected={state.selectedCards.includes(item.pk)}/>
                    </Col>
                })}
            </Row>
        </>
    );
}

export default Rent;
